import React, { Component } from 'react';
import './TextInput.scss';


const TextInput = (props)=> {

  return(
      <input type = "text" name={props.name} className = {`text-input ${props.size === "small" ? 'text-input--small' : null}`} /> 
  )

}

export default TextInput;
